There were 6 chicken wings already cooked, and the chef cooked 3 more, so in total, there are 6+3=9 chicken wings. The 3 friends will share these wings equally. To find out how many each person gets, we need to divide the total number of wings by the number of friends: 9 ÷ 3 = 3. 

So each person will get 3 chicken wings.

Answer: {3}
